import React from 'react';
import {  BrowserRouter as Router, Switch, Link, Route } from 'react-router-dom'

const Footer = () => {
    return (
        <div className="colophon">
            <Switch>
                <Route path="/contact">
                    <ul>
                        <li><Link to="/contact">Contacto</Link></li>
                    </ul>
                </Route>
            </Switch>
        </div>
    )
}

export default Footer
